a = 9                           # Weist der Variablen 'a' den Wert 9 (eine Ganzzahl) zu.
b = 0.5                         # Weist der Variablen 'b' den Wert 0.5 (eine Fließkommazahl) zu.
print(a % b)                    # Gibt den Rest der Division von 'a' durch 'b' aus (9 % 0.5 = 0.0).
print(a ** b)                   # Gibt 'a' hoch 'b' (9^0.5 = Quadratwurzel von 9) aus, was 3.0 ergibt.
"a" + "b"                       # Verkettet die Strings "a" und "b", ergibt "ab", aber wird hier nicht ausgegeben.
1 + 2.9                         # Addiert die Ganzzahl 1 und die Fließkommazahl 2.9, ergibt 3.9, aber wird nicht ausgegeben.
print(False + True)             # Gibt die Summe von False (0) und True (1) aus, was 1 ergibt.